import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    font: {
        flexGrow: 1,
        display: 'flex',
        color: '#000000',
        fontFamily: 'liebedoni-solid',
        fontSize: 40,
    },
    text: {
        flexGrow: 1,
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        color: '#000000',
        fontSize: 20,
    }
    }));

export default useStyles;
